Available Tools and their Descriptions:
    multiply_numbers: Multiplies two numbers. Arguments: num1 (required, number), num2 (required, number).
    divide_numbers: Divides two numbers. Arguments: num1 (required, number), num2 (required, number).
    draft_email: Drafts an email. Arguments: subject (required, string), recipient (required, string), content (required, string).
    summarize_text: Summarizes the given text. Arguments: text (required, string)

    Goal: Multiply 3 and 3, divide by 2, multiply by 3, send division result to ddd@dd.com, and multiplication result to 22@22.com

    Graph:
    {
      "start": ["multiply_numbers_1"],
      "multiply_numbers_1": {
        "tool": "multiply_numbers",
        "input": {
          "num1": 3,
          "num2": 3
        },
        "next": ["divide_numbers_1"]
      },
      "divide_numbers_1": {
        "tool": "divide_numbers",
        "input": {
          "num1": "{multiply_numbers_1}",
          "num2": 2
        },
        "next": ["multiply_numbers_2", "draft_email_1"]
      },
      "multiply_numbers_2": {
        "tool": "multiply_numbers",
        "input": {
          "num1": "{divide_numbers_1}",
          "num2": 3
        },
        "next": ["draft_email_2"]
      },
      "draft_email_1": {
        "tool": "draft_email",
        "input": {
          "recipient": "ddd@dd.com",
          "subject": "Division Result",
          "content": "The result of the division is {divide_numbers_1}"
        },
        "next": ["end"]
      },
      "draft_email_2": {
        "tool": "draft_email",
        "input": {
          "recipient": "22@22.com",
          "subject": "Multiplication Result",
          "content": "The result of the second multiplication is {multiply_numbers_2}"
        },
        "next": ["end"]
      },
      "end": {}
    }
